import React, {useState} from 'react'
import "./Card.css";

function Card( {src, title, description,price} ){
  return (
    <div className='card'>
        <img src={src} alt=''/>
        <div className='card_info'>
            <h2>{title}</h2>
            <h4>{description}</h4>
        </div>
        <div className='card_button'>
            <button>Book Now</button>
        </div>
    </div>
  )
}

